// src/App.tsx
import React, { Suspense, lazy, useContext } from 'react';
import { Box, AppBar, Toolbar, Typography, IconButton } from '@mui/material';
import { ColorModeContext } from './ThemeContext';
import Brightness4Icon from '@mui/icons-material/Brightness4';

// Lazy-load the main components. Ensure these files exist with the same names.
const ChatInterface = lazy(() => import('./components/ChatInterface'));
const QueryForm = lazy(() => import('./components/QueryForm'));
const FileUpload = lazy(() => import('./components/FileUpload'));

const App: React.FC = () => {
  const colorMode = useContext(ColorModeContext);

  return (
    <Box>
      <AppBar position="static">
        <Toolbar>
          <Typography variant="h6" sx={{ flexGrow: 1 }}>
            Electrical AI Dashboard
          </Typography>
          <IconButton onClick={colorMode.toggleColorMode} color="inherit">
            <Brightness4Icon />
          </IconButton>
        </Toolbar>
      </AppBar>
      <Box component="main" sx={{ p: 2 }}>
        <Suspense fallback={<div>Loading Chat Interface...</div>}>
          <ChatInterface />
        </Suspense>
        <Suspense fallback={<div>Loading Query Form...</div>}>
          <QueryForm />
        </Suspense>
        <Suspense fallback={<div>Loading File Upload...</div>}>
          <FileUpload endpoint="upload_receipt" label="Upload Receipt" />
        </Suspense>
      </Box>
    </Box>
  );
};

export default App;
